    this.state({nome: event.target.value})
  }

  handleEmail= (event) => {
    this.state({email: event.target.value})
  }

  cadastrandoUsuarios = () => {
    console.log(this.cadastrandoUsuarios)
  }

  render() {
    return (
      <div>
        CadastroUsuarios
        <br/>
